import React from "react";
import './card.css';
function Card(props) {
    return(
      
        <div className="div-card">
            <div className="carrinho">5</div>
            <div className="card" >
                <img src="./Image/relogio.png" className="card-img-top" alt="..." />
                <div className="card-body">
                    <p className="card-text">Apple Watch Series 4 GPS</p>
                    <div className="price"><span> R$399</span></div>
                </div>
                <p className="card-subtext">Redesigned from scratch and completely revised.</p>
                <input className="brn-comprar" type="button" value="Comprar" />
            </div> 

             
        </div>

    );
    
}

export default Card;
